        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Dans le soucis de répondre aux besoins croissants des entreprise en intégration de solutions informatiques ; le programme Informatique, réseaux
                    & télécom dispensé par B2I, dans le cadre du schéma LMD est un enseignement ayant pour objectif de préparer en trois ans leurs étudiants aux
                    fonctions d’ingénieurs des travaux tout en leur offrant la possibilité de poursuivre leurs études suivant leur projet personnel et professionnel
                    élaboré dès le pre");
            WriteLiteral(@"mier semestre de leur formation. Pour atteindre cet objectif, la formation repose sur un enseignement par unités d’enseignement
                    (UE) qui comprend des unités fondamentales, complémentaires et transversales permettant à l’étudiant de définir son parcours conformément à
                    son Projet Personnel et Professionnel.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif de ce programme est de former des diplômés polyvalents dans les métiers de la technologie des réseaux et systèmes informatiques et
                    ayant en particulier de solides connaissances en systèmes d’exploitation et en télécommunication. À la fin de ce programme, les diplômés seront
                    en mesure de mettre à profit leur compéten");
            WriteLiteral(@"ce acquise dans différentes entreprises offrant des solutions dans le domaine de la technologie des
                    réseaux et systèmes informatiques.	  
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’apprenant, à l’issue de ce programme sera capable de : <br/>
                </p>
                <ul class=""one_list"">
                    <li> D’intégrer les sociétés de service et les constructeurs d’équipements réseaux ; </li>
                    <li> De travailler avec les opérateurs de télécommunications et fournisseurs d’accès à Internet, </li>
                    <li> D’intégrer les entreprises et les administrations gérant elles-mêmes leurs systèmes d’information et de communication ;</li>
                    <li> De travailler dans les sociétés de services et d’ingénierie informatiques ; </li>
           ");
            WriteLiteral(@"         <li> Exécuter les opérations informatiques, sauvegardes/Restaurations dans les entreprises ; </li>
                    <li> Cadrer et mettre en œuvre des projets informatiques locaux pour les entreprises; </li>
                    <li> Elaborer des études pour la mise en place d’un environnement de collaboration SharePoint Server 2010 ; </li>
                    <li> Assister l’administrateur du réseau et système ; </li>
                    <li> Assurer la gestion et la maintenance de tous les types de réseaux ; </li>
                    <li> Intégrer une équipe chargée de traiter des questions de réseaux informatiques classiques, réseaux téléphoniques, réseaux à intégration de
                            services, réseaux mobiles, etc. 
                    </li>
                    <li> D’assurer un lien entre les clients de l'entreprise et une équipe technique ; </li>
                    <li> Maîtriser les grandes structures multi-réseaux, notamment grâce à une bonne connaissance des probl");
            WriteLiteral(@"èmes d’interconnexions et de gestion de
                         réseau ; 
                    </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme prépare au parcours de technologie des réseaux et systèmes informatiques et qui a pour but de préparer aux carrières d’Ingénieurs
                    des travaux.
